import base64
import os

response_data = {
    "similarImagesBase64": [
        "",
        "",
        "",
        "",
        ""
    ]
}
  
save_dir = 'similar_images'
os.makedirs(save_dir, exist_ok=True)

for idx, base64_string in enumerate(response_data['similarImagesBase64']):
    try:
        img_data = base64.b64decode(base64_string)
        file_path = os.path.join(save_dir, f'similar_image_{idx+1}.png')
        with open(file_path, 'wb') as f:
            f.write(img_data)
        print(f"Saved: {file_path}")
    except Exception as e:
        print(f"Failed to save image {idx+1}: {e}")
